import React from 'react'

export default function Free() {
  return (
    <div id="freelancing" style={{ backgroundColor: '#6B3BA8' }} className="freelancing py-5 text-center text-light">
      <p className='fs-5'>Do you have any project?</p>
      <h1 className="py-3 fw-bold fs-1 ">I'm Available For Freelancing Projects</h1>
      <a href="mailto:abdelouahadkouki@gmail.com">
        <button type="button" className=" fs-4 btn btn-outline-light mt-3">Hire Me</button>
      </a>
    </div>
  )
}
